  `_id` char(24) NOT NULL DEFAULT '' COMMENT '兑换成功ID',
  `user_id` char(50) NOT NULL DEFAULT '' COMMENT '用户编号',
  `prize_id` char(24) NOT NULL DEFAULT '' COMMENT '奖品ID',
  `quantity` int(10) NOT NULL DEFAULT '0' COMMENT '数量',
