 0.0px;\"><span style=\"padding: 0.0px;margin: 0.0px;\">3、<span style=\"color: #ffff00;\"><span style=\"color: #000000;\"><span style=\"background-color: #00ffff;\"><span style=\"padding: 0.0px;margin: 0.0px;\">超大发热盘</span></span></span></span>，加热速度快，还能煎鸡蛋、烙饼、煎牛排。</span></span></strong></span></span><strong style=\"font-size: 18.0px;padding: 0.0px;margin: 0.0px;\"><span style=\"padding: 0.0px;margin: 0.0px;\"><span style=\"padding: 0.0px;margin: 0.0px;\"><span style=\"background-color: #ffffff;\"><span style=\"padding: 0.0px;margin: 0.0px;\">配不锈钢蒸盘+1个陶瓷蒸碗</span>，耐用又健康</span>。</span></span></strong></span></p> <p style=\"margin-top: 1.12em;margin-bottom: 1.12em;color: #404040;\"><span style=\"color: #9900ff;\"><strong style=\"font-size: 18.0px;padding: 0.0px;margin: 0.0px;\"><span style=\"padding: 0.0px;margin: 0.0px;\"><span style=\"padding: 0.0px;margin: 0.0px;\"><strong style=\"color: #9900ff;font-size: 18.0px;line-height: 27.0px;padding: 0.0px;margin: 0.0px;\"><span style=\"padding: 0.0px;margin: 0.0px;\"><span style=\"padding: 0.0px;margin: 0.0px;\">4、</span></span></strong></span></span></strong></span><b style=\"background-color: #ff0000;color: #ffff00;text-align: center;font-size: 18.0px;padding: 0.0px;margin: 0.0px;\"><span style=\"color: #000000;\"><span style=\"background-color: #00ffff;\">多功能：</span></span><span style=\"color: #9900ff;\"><span style=\"background-color: #ffffff;\">煮鸡蛋，蒸蛋羹，煎鸡蛋，煎饺子，煎牛排，烙饼等</span></span></b><span style=\"color: #000000;\"><b style=\"background-color: #ff0000;color: #ffff00;text-align: center;font-size: 18.0px;padding: 0.0px;margin: 0.0px;\"></b></span></p> <p style=\"text-align: left;\"><span style=\"color: #000000;\"><strong><span style=\"font-size: 18.0px;\"><span style=\"background-color: #00ffff;\">一：蒸蛋器尺寸</span></span></strong></span></p> <p style=\"text-align: left;display: inline;\"><span style=\"font-size: 18.0px;\"><span style=\"color: #000000;\">蒸蛋器高度225(mm)，锅为圆锅，直径宽度200(mm)，手柄长度140（mm）加热盘内直径170（mm）加热盘高度为15(mm)，是一般的比较大的蒸蛋器，并非并非大电蒸锅噢！！！</span></span></p> <b style=\"background-color: #ff0000;color: #ffff00;text-align: center;font-size: 18.0px;padding: 0.0px;margin: 0.0px;\"><span style=\"color: #9900ff;\"><span style=\"background-color: #ffffff;\"> <p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"background-color: #00ffff;\">二：旋钮是做什么用的？</span></span></p> <p style=\"text-align: left;\"><span style=\"color: #000000;\">这款旋钮并非是定时器。而是温度调节器呢！最高温度可以调节至200度。也可以开低温保温。</span></p> <p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"background-color: #00ffff;\">三：蒸蛋器会自动断电吗</span></span></p> <p style=\"text-align: left;\"><span style=\"color: #000000;\">这款是温控的。不是自动断电的，这款蒸蛋器水干了，底锅温度达到200度，灯会灭，会自动停 底锅温度下降，灯会再次亮起。就继续加热。所以这款煎食物是不会烧焦的。非常的实用。</span></p> <p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"background-color: #00ffff;\">四：煎食物的时候，为什么会突然停了？</span></span></p> </span></span></b><b style=\"background-color: #ff0000;color: #ffff00;text-align: center;font-size: 18.0px;padding: 0.0px;margin: 0.0px;\"><span style=\"color: #9900ff;\"><span style=\"background-color: #ffffff;\"> <p style=\"text-align: left;\"><span style=\"font-size: 18.0px;\"><span style=\"color: #000000;\">这款温控设计的。当底盘达到200度，就会自动停止，这个时候您只要翻过来食物，在等一下下，就会再次继续加热了，这个设计是为了防止食物烧焦，并非是接触不良噢！！</span></span><img align=\"absmiddle\" src=\"http://img02.taobaocdn.com/imgextra/i2/735634545/TB2mi_IapXXXXaqXXXXXXXXXXXX-735634545.jpg\" style=\"font-size: 14.0px;font-weight: normal;line-height: 1.5;color: #222222;orphans: 2;widows: 2;\"></p> </span></span></b> <p style=\"margin-top: 1.12em;margin-bottom: 1.12em;color: #404040;\"><b style=\"background-color: #ff0000;color: #ffff00;text-align: center;font-size: 18.0px;padding: 0.0px;margin: 0.0px;\"></b></p> <p><img align=\"absmiddle\" src=\"http://img01.taobaocdn.com/imgextra/i1/735634545/T2bvbrXaFbXXXXXXXX_!!735634545.jpg\"><img align=\"absmiddle\" src=\"http://img01.taobaocdn.com/imgextra/i1/735634545/T282KLXaJcXXXXXXX