  `_id` char(24) NOT NULL DEFAULT '' COMMENT '规格id',
  `name` varchar(100) NOT NULL DEFAULT '' COMMENT '规格名称',
  `sort` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
